import './items-list.css';

function ItemList() {
  return (
    <div className="item-list">
      <table className="table-background">
        <tr>
          <th>Item</th>
          <th>Price</th>
          <th>Amount</th>
          <th>Item</th>
        </tr>
      </table>
    </div>
  );
}

export default ItemList;
